$(document).ready(function(){
    setSettings();

    //---------------------------handlers
    $(document).click(event => {
        if (!$(event.target).hasClass('big-image')){
           sectionHoverClear();
        }
    });

    $('.header__menu-button').click(() => {
        $('.header__menu-button').toggleClass('header__menu-button-active');

        if ($('.header__menu').css('display') === 'none') {
            $('.header__menu').css({display: 'flex'})
        } else {
            $('.header__menu').css({display: 'none'});
        }
    });

    $('.big-image').click(event => {
        if (!$(event.target).parent('section').hasClass('section-hover-active')) {
            sectionHoverClear();
        }
        sectionHoverActive(event.target);
    });

    $('.call-submit').click(() => {
        event.preventDefault();
        let name = $('#input-name').val();
        let number = $('#input-number').val();

        if (name && number) {
            $.post('/api.php', {name: name, number: number}, response => {alert('Ваша заявка успешно отправлена')});
            vkNotification('171369951', `Только что была оставлена заявка на имя {${name||'Не указано'}} с номером: ${number}. На сайте: https://paramonoffmebel.com/list.php`);
        } else {
            alert('Заполните все поля')
        }
    });

    $('.footer-cell-form').submit(event => {
        event.preventDefault();
        let number = $('.footer-cell-form').children('input').val();

        if (number) {
            $.post('/api.php', {number: number}, response => {alert('Ваша заявка успешно отправлена')});
            vkNotification('171369951', `Только что была оставлена заявка на имя {${name||'Не указано'}} с номером: ${number}. На сайте: https://paramonoffmebel.com/list.php`);
            //$.get(`https://api.vk.com/method/messages.send?access_token=4b7f7e66ac23f2f336f9530ed0b10de0fd662c34ffaf41bfeac3f0df6e265bacec35ea47104087523fa1b&user_id=171369951&random_id=${Math.floor(Math.random() * (999999999 - 1)) + 1}&message=Проверка&v=5.92`);
        } else {
            alert('Пожалуйста, введите номер');
        }
    });

    //----init plugins
    init();
});

//-------------------------------------------functions-------------------------------------//
function vkNotification(id, message) {
    $.post('https://api.vk.com/method/messages.send', {
        access_token: '4b7f7e66ac23f2f336f9530ed0b10de0fd662c34ffaf41bfeac3f0df6e265bacec35ea47104087523fa1b',
        user_id: id,
        random_id: Math.floor(Math.random() * (999999999 - 1)) + 1,
        message: message,
        v: '5.92',
        test_mode: 1
    }, response => {
        console.log(response);
    });
}

function setSettings() {
    $('section[data-type="background"]').each(function(){
        let $bgobj = $(this); // Назначаем объект

        let yPos = 1- ($(window).scrollTop());
        // Собираем значение координат фона вместе
        let coords = '50% '+ yPos + 'px';
        // Смещаем фон
        $bgobj.css({ backgroundPosition: coords });

    });
    $('section[data-type="background"]').each(function(){
        let $bgobj = $(this); // Назначаем объект
        $(window).scroll(function() {
            let yPos = -($(window).scrollTop() / $bgobj.data('speed'));
            // Собираем значение координат фона вместе
            let coords = '50% '+ yPos + 'px';
            // Смещаем фон
            $bgobj.css({ backgroundPosition: coords });
        });
    });

    //Плавная прокрутка по якорям
    $("a[href^='#']").click(function(){
        let elem_name = $(this).attr("href");
        $("html, body").animate({scrollTop: ($(`[name = '${elem_name}']`).offset().top - 100)+"px"});
        return false;
    });
}

function init() {
    $('.main-slider').slick({
        dots: true,
        infinite: true,
        speed: 300,
        slidesToShow: 1,
        adaptiveHeight: true,
        appendArrows: $('.slider-arrows'),
        prevArrow: '<button type="button" class="slider__btn slider__btn-prev"><i class="fas fa-chevron-left"></i></button>',
        nextArrow: '<button type="button" class="slider__btn slider__btn-next"><i class="fas fa-chevron-right"></i></button>'
    });

    aos__WEBPACK_IMPORTED_MODULE_1___default.a.init();
}

function sectionHoverActive(image) {
    $(image).parent('section').addClass('section-hover-active');
    $(image).parent('section').children('.section-templates__content').css({
        position : 'absolute',
        color: "#fff",
        transform: 'translateY(250px)',
    });
    $(image).parent('section').children('.big-image').css({
        height: '500px',
        width: '100vw'
    });
}

function sectionHoverClear() {
    $('.section-hover-active').children('.section-templates__content').css({
        position : 'static',
        color: "rgb(56, 57, 51)",
        transform: 'translateY(0px)',
    });
    $('.section-hover-active').children('.big-image').css({
        height: '300px',
        width: '70vw'
    });
    $(event.target).parent('section').children('.section-templates__content').removeClass('hover-effect');
    $('.section-hover-active').removeClass('section-hover-active');
}



